import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faLinkedin, faGithub  } from '@fortawesome/free-brands-svg-icons';
import { faFileDownload } from '@fortawesome/free-solid-svg-icons';

import './Intro.css';
import headshot from '../../assets/headshot.jpeg';


const Intro = (props) => {

    return (
        <div className="intro-container">
            <div className="intro-background">
                <div className="info-container">
                    <img
                        alt="headshot"
                        src={headshot}
                        className="headshot"
                    />
                    <div className="content">
                        <p className="name">Hi, I'm Neel.</p>
                        <p className="intro-text">Full Stack Software Developer</p>
                        <p className="intro-text"><strong>Education: </strong> 2nd Year CS Student @ UWaterloo</p>
                        <p className="intro-text"><strong>Experience: </strong> Incoming SWE @ RBC Capital Markets, Prev @ Fidelity Investments</p>
                        <p className="intro-text"><strong>Education: </strong> 2nd Year CS Student @ UWaterloo</p>
                        <div className="icons-row">
                            <a href="https://www.linkedin.com/in/neelismail/" >
                                <FontAwesomeIcon icon={faLinkedin} size="lg" className="icon" />
                            </a>
                            <a href="https://www.linkedin.com/in/neelismail/" >
                            <   FontAwesomeIcon icon={faFileDownload} size="lg" className="icon" />
                            </a>
                            <a href="https://github.com/neelismail01" >
                                <FontAwesomeIcon icon={faGithub} size="lg" className="icon" />
                            </a>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Intro;
